import React from "react"
import { Box, HStack } from "@chakra-ui/react";
import "../Css/Nav.css"

const navlinks = [
    {
        name: "Home",
        link: "/home",
    },
    {
        name: "About",
        link: "/about",
    },
    {
        name:"Menu",
        link:"/menu",
    },
    {
        name:"Reservations",
        link:"/reservations",
    },
    {
        name:"order",
        link:"/order",
    },

    {
        name: "Login",
        link: "/login",
    },

];

const image =[
    {
        source: "./Assets/images/Logo.png",
        name:  "Log",
    }
];

const Nav = () =>{
return (
    <nav>
        <div class = "flex-container" >
        <img src= "../asset/Logo.png" alt = "Logo" width="50" height="60"/>
        {navlinks.map((navlink, index) => (
            <a href={navlink.link} class = "flex-item" gap ="2px">{navlink.name}</a>
        ))}
        </div>
    </nav>
);

};
export default Nav;
